import React from 'react';
import '../css/CartPage.css'; // Path to CSS file
import honeyJarImg from '../images/single.jfif'; // Path to image

const CartPage = () => {
  return (
    <div className="cart-page">
      <h1 className="cart-title">עגלה (Cart)</h1>
      <div className="cart-content">
        <div className="cart-item">
          <img src={honeyJarImg} alt="Honey Jar" className="cart-item-image" />
          <div className="cart-item-details">
            <h2>Honey Jar</h2>
            <p>Price: $10.00</p>
            <button>Remove</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default CartPage;
